export const getMovieByLanguage = async () => {
  console.log("hit");
  try {
    const response = await axios.get(
      `${process.env.TMDB_PUBLIC_URL}/3/configuration/languages`,
      {
        headers: {
          accept: "application/json",
          Authorization: `Bearer eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOiI5NTdlMjRhMjNkZDBkM2YxODgyZjI3NjNlYTE2NWE4NiIsIm5iZiI6MTcyMTIwMjUxMS4zMTk2NDgsInN1YiI6IjY2OTc3NjZmZWMzYzIxODljZTUwODEyYyIsInNjb3BlcyI6WyJhcGlfcmVhZCJdLCJ2ZXJzaW9uIjoxfQ.bwDbjFWZS1rsztwiXqP7jHvQ66WsbUkGz2gx_Z8NiSY'`,
        },
      }
    );
    console.log("response", response);
  } catch (error) {
    console.log("Error retreiving languages: ", error);
  }
};
